Chev Chelios (Jason Statham) komt bij zinnen in de handen van enkele Chinese bendeleden die zijn hart stelen en vervangen door
een kunsthart. Deze loopt op batterijen die de regelmatige schok van elektriciteit vereist om werking bij te houden. Voor Chev
volgt een race door Los Angeles, om alles weer recht te zetten, wraak te nemen en zijn eigen hart terug te vinden.
